import React from 'react';
import './Header.css';
import SearchOutlinedIcon from '@material-ui/icons/SearchOutlined';

function Header() {
    return (
        <div className='header'>
            <div className='header_left'>
                <SearchOutlinedIcon />
                <input
                    placeholder='Search'
                    type='text' 
                />
            </div>

            <div className='header_right'>

            </div>
        </div>
    )
}

export default Header;
